import React from "react";
import { Button } from 'antd';

// components
import CardPageVisits from "components/Cards/CardPageVisits.js";
import Header from "components/Headers/Header.js";
import { useHistory } from "react-router";

export default function NewProject() {
    let history = useHistory();

    const handleExistingProject = () => {
        history.push('/admin/project/existing');
    }

    const handleNewProject = () => {
        history.push('/admin/project/new');
    }

    return (
        <>
            <div style={{minHeight: "80vh"}} className="flex justify-center items-center bg-white">
                <div>
                    <Card title="Create a new project or choose an existing one" style={{width: '400px'}}>
                        <Card.Grid
                            style={gridStyle}
                            onMouseEnter={(e) => setNewProjectFocus(true)}
                            onMouseLeave={() => setNewProjectFocus(false)}
                            onClick={() => handleNewProject()}
                            className={newProjectFocus ? 'bg-primary text-white cursor-pointer': ''}
                        >
                            Create new project
                        </Card.Grid>
                        <Card.Grid
                            style={gridStyle}
                            onMouseEnter={(e) => setExistingProjectFocus(true)}
                            onMouseLeave={() => setExistingProjectFocus(false)}
                            onClick={() => handleExistingProject()}
                            className={existingProjectFocus ? 'bg-primary text-white cursor-pointer': ''}
                        >
                            Select existing project
                        </Card.Grid>
                    </Card>
                </div>
            </div>
        </>
    );
}
